import axios from 'axios';

const TravelPlanUser_API_BASE_URL="http://localhost:8087/api/user/";

class AuthService{
createUser(UserData){
    return axios.post(TravelPlanUser_API_BASE_URL,)
}
}
export default new AuthService();
